import React, { useEffect, useState } from 'react';
import { FiPhone, FiPhoneIncoming, FiPhoneOutgoing, FiPhoneMissed } from 'react-icons/fi';

const formatDate = (startStamp) => {
  const date = new Date(startStamp);
  return date.toLocaleDateString('en-US', { year: 'numeric', month: 'short', day: 'numeric' });
};

const formatTime = (startStamp) => {
  const date = new Date(startStamp);
  return date.toLocaleTimeString('en-US', { hour: '2-digit', minute: '2-digit' });
};

const calculateDuration = (duration) => {
  const minutes = Math.floor(duration / 60);
  const seconds = duration % 60;
  return `${minutes}m ${seconds}s`;
};

const CallLog = ({ darkMode }) => {
  const [cdrLogs, setCdrLogs] = useState([]);

  const fetchData = () => {
    fetch('https://server-ou54.onrender.com/webapi/core/cdr')
      .then((response) => response.json())
      .then((data) => {
        const sortedData = data.sort((a, b) => new Date(b.start_stamp) - new Date(a.start_stamp));
        setCdrLogs(sortedData);
      })
      .catch((error) => console.error('Error fetching data:', error));
  };

  useEffect(() => {
    fetchData();
    const interval = setInterval(fetchData, 5000);
    return () => clearInterval(interval);
  }, []);

  const getCallTypeIcon = (type) => {
    switch (type) {
      case 'incoming':
        return <FiPhoneIncoming className="text-green-500" />;
      case 'outgoing':
        return <FiPhoneOutgoing className="text-blue-500" />;
      case 'missed':
        return <FiPhoneMissed className="text-red-500" />;
      default:
        return <FiPhone className="text-gray-500" />;
    }
  };

  return (
    <div
      className={`p-6 rounded-lg shadow-md ${
        darkMode ? 'bg-gray-800 text-white' : 'bg-white text-gray-900'
      } transition-all`}
    >
      <h1 className="text-2xl font-semibold mb-6 text-center">Call Log</h1>
      <div className="overflow-x-auto">
        <table className="min-w-full table-auto">
          <thead
            className={`${
              darkMode ? 'bg-gray-700 text-gray-300' : 'bg-gray-100 text-gray-700'
            }`}
          >
            <tr>
              <th className="py-3 px-4 text-left">Date</th>
              <th className="py-3 px-4 text-left">Time</th>
              <th className="py-3 px-4 text-left">Caller</th>
              <th className="py-3 px-4 text-left">Type</th>
              <th className="py-3 px-4 text-left">Duration</th>
            </tr>
          </thead>
          <tbody>
            {cdrLogs.length > 0 ? (
              cdrLogs.map((log, index) => (
                <tr
                  key={log.serial_number}
                  className={`${
                    index % 2 === 0
                      ? darkMode
                        ? 'bg-gray-700'
                        : 'bg-gray-50'
                      : darkMode
                      ? 'bg-gray-600'
                      : 'bg-white'
                  } hover:${
                    darkMode ? 'bg-gray-500' : 'bg-gray-200'
                  } transition-colors`}
                >
                  <td className="py-3 px-4">{formatDate(log.start_stamp)}</td>
                  <td className="py-3 px-4">{formatTime(log.start_stamp)}</td>
                  <td className="py-3 px-4">{log.caller_id_name}</td>
                  <td className="py-3 px-4 flex items-center">
                    {getCallTypeIcon(log.call_type)}
                    <span className="ml-2">{log.call_type || 'N/A'}</span>
                  </td>
                  <td className="py-3 px-4">{calculateDuration(log.duration)}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td
                  colSpan="5"
                  className="py-4 text-center text-lg text-gray-500"
                >
                  No call logs available.
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default CallLog;
